     &lt;li&gt; Address: tcp://172.21.3.52:8786 &lt;/li&gt;\n          &lt;li&gt; Workers: 16 &lt;/li&gt;\n          &lt;li&gt; Threads: 384 &lt;/li&gt;\n          &lt;li&gt; Memory: 2.70 TiB &lt;/li&gt;\n          &lt;li&gt; Dask Version: 2021.11.2 &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 0+unknown &lt;/li&gt;\n        &lt;/ul&gt;\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\n# import h5py\nfrom dask_ml.decomposition import InSituIncrementalPCA\nfrom dask_interface import Deisa\nfrom dask.distributed import performance_report, wait \nimport os\nimport time \n\n# Scheduler file name and configuration file\nscheduler_info = 'scheduler.json'\nconfig_file = 'config.yml'\n\n# Initialize the Deisa \nDeisa = Deisa(scheduler_info, config_file)\n\n# Get client\nclient = Deisa.get_client()\n\n# Get data descriptor as a list of Deisa arrays object\narrays = Deisa.get_deisa_arrays()\n\n# Select data\ngt = arrays[\"global_t\"][...]\nprint(gt, flush=True)\n\n# Check contract\narrays.check_contract()\narrays.validate_contract()\n\n\nt = time.perf_counter()\n\nwith performance_report(filename=\"dask-report.html\"):\n        pca=InSituIncrementalPCA(n_components=2,copy=False, svd_solver='randomized')\n        print(\"pca, \", pca, flush=True)\n        l = pca.fit(gt, [\"t\", \"X\", \"Y\"], [\"X\"], [\"Y\"]) \n        #cpt = [pca.mean_ , pca.var_ , pca.components_ , pca.explained_variance_ , pca.explained_variance_ratio_ , pca.singular_values_ ]\n        # Submit the task graph to the scheduler\n        cpt = [ pca.explained_variance_ , pca.singular_values_]\n        explained_variance ,singular_values  = client.persist(cpt)\n        explained_variance , singular_values = client.compute([explained_variance ,singular_values])    \n        print(\"explained_variance ,singular_values: \", explained_variance.result(), \" and \" , singular_values.result(), flush=True)\nprint(\"Done in :\", time.perf_counter() - t, flush=True)\n\nclient.shutdown()\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{},"id":"1492","type":"BasicTickFormatter"},{"attributes":{},"id":"1297","type":"BasicTicker"},{"attributes":{"tabs":[{"id":"1402"},{"id":"1406"},{"id":"1409"},{"id":"1410"},{"id":"1403"},{"id":"1404"},{"id":"1405"},{"id":"1407"},{"id":"1408"}]},"id":"1411","type":"Tabs"},{"attributes":{"child":{"id":"1039"},"title":"Scheduler Profile (administrative)"},"id":"1405","type":"Panel"},{"attributes":{"data":{"cpu":["min: 0.0%","max: 76.5%","mean: 4.9%"],"memory":["min: 94.75 MiB","max: 138.95 MiB","mean: 118.17 MiB"],"x":[5,5,5],"y":[70,55,40]},"selected":{"id":"1525"},"selection_policy":{"id":"1524"}},"id":"1214","type":"ColumnDataSource"},{"attributes":{"follow":"end","follow_interval":20000,"range_padding":0},"id":"1215","type":"DataRange1d"},{"attributes":{},"id":"1493","type":"AllLabels"},{"attributes":{"coordinates":null,"group":null,"text":"Bandwidth"},"id":"1283","type":"Title"},{"attributes":{"factors":["numpy.ndarray"]},"id":"1187","type":"FactorRange"},{"attributes":{"child":{"id":"bk-task-stream-plot"},"title":"Task Stream"},"id":"1406","type":"Panel"},{"attributes":{},"id":"1198","type":"CategoricalTicker"},{"attributes":{},"id":"1495","type":"DatetimeTickFormatter"},{"attributes":{"child":{"id":"bk-bandwidth-worker-plot"},"title":"Bandwidth (Workers)"},"id":"1407","type":"Panel"},{"attributes":{"below":[{"id":"1226"}],"center":[{"id":"1229"},{"id":"1233"},{"id":"1247"}],"height":150,"left":[{"id":"1230"}],"renderers":[{"id":"1245"}],"sizing_mode":"stretch_both","title":{"id":"1217"},"toolbar":{"id":"1237"},"toolbar_location":"above","x_range":{"id":"1215"},"x_scale":{"id":"1222"},"y_range":{"id":"1220"},"y_scale":{"id":"1224"}},"id":"1216","subtype":"Figure","type":"Plot"},{"attributes":{"line_alpha":0.1,"line_color":"#1f77b4","x":{"field":"time"},"y":{"field":"num_fds"}},"id":"1395","type":"Line"},{"attributes":{},"id":"1222","type":"LinearScale"},{"attributes":{},"id":"1496","type"
